    "# Extracting data that will be used to decrease the data's size\n",
    "data <- data[,c(\"Age\", \"Gender\", \"Blood.Type\", \"Medical.Condition\", \"Date.of.Admission\", \"Discharge.Date\", \"Insurance.Provider\", \"Billing.Amount\", \"Admission.Type\", \"Medication\", \"Test.Results\")]\n",
    "\n",
    "# Split Bloodtype into Bloodtype and Rh factor\n",
    "data[, \"blood\"] <- data[, \"Blood.Type\"] # Create a copy that contains both Bloodtype and Rh factor\n",
    "data <- separate(data, col= Blood.Type, into= c(\"blood_type\", \"rh_type\"), sep = -1) # Separate Bloodtype and Rh factors\n",
    "colnames(data) <- c(\"age\", \"gender\", \"blood_type\", \"rh_type\", \"condition\", \"admission_date\", \"discharge_date\", \"insurance\", \"billing\", \"admission_type\", \"medication\", \"result\", \"blood\") # Rename headers\n",
    "\n",
    "# Change into Datetime data type\n",
