   "source": [
    "# Distribution based on Age Groups, containing all ages less than the showing label\n",
    "data[, \"age_group\"] <- case_when(\n",
    "  data[, \"age\"] <= 25 ~ 25,\n",
    "  data[, \"age\"] <= 35 ~ 35,\n",
    "  data[, \"age\"] <= 45 ~ 45,\n",
    "  data[, \"age\"] <= 55 ~ 55,\n",
    "  data[, \"age\"] <= 70 ~ 70,\n",
    "  TRUE ~ 100\n",
    ")\n",
    "\n",
    "data %>% \n",
    "ggplot() + \n",
    "  geom_bar(aes(x=as.factor(age_group), fill=as.factor(age_group))) + \n",
    "  facet_grid(condition~.) +\n",
    "  labs(fill = \"age_group\") +\n",
    "  xlab(\"age_group\")"
   ]
