    "# On average, How many days in the hospital did patients stay due to their condition\n",
    "condition_average_duration <- data %>% ggplot() + \n",
    "  geom_boxplot(\n",
    "      aes(x=condition, y=(discharge_date - admission_date), color = condition, fill = condition),\n",
    "      alpha = 0.3) +\n",
    "  ylab(\"duration_length\") +\n",
    "  scale_y_continuous() # To scale <datediff> in y axis\n",
    "condition_average_duration"
   ]
